import numpy as np

def submatrix_with_n_numbers(matrix):
    count = 0
    rows, columns = matrix.shape

    for i in range(rows):
        for j in range(columns):
            if matrix[i, j] == 77:
                count += 1
                for k in range(i+1, rows):
                    for l in range(j+1, columns):
                        if np.sum(matrix[i:k+1, j:l+1]) == 77:
                            count += 1

    return count
